INSERT INTO `ow_project_description` VALUES ('acceleo','Acceleo is a code generator which uses the MDA approach to easily design applications with models. Acceleo is natively based on Eclipse EMF and can be extended to target any technology.',77,'2007-07-01 11:09:24'),('activexml','Active XML is a declarative framework based on XML documents with embedded calls to Web services that harnesses web services for data management and is put to work in a peer-to-peer architecture.',77,'2007-07-01 11:09:24'),('apollon','Generation engine able to build graphical user interfaces (GUI) from DTDs and customization models. This makes the GUIs adapted to the edition of XML documents.',77,'2007-07-01 11:09:24'),('barracudamvc','Barracuda is an open-source Presentation Framework designed to make it easier to build servlet based webapps by applying proven client-server patterns to the web development paradigm. It includes a DOM based templating mechanism for better separation',77,'2007-07-01 11:09:24'),('been','BEEN: Framework for Integrating Performance Evaluation in Development Cycle',77,'2007-07-01 11:09:24'),('bonita','Bonita provides out of the box workflow functionalities to define and run business processes : enactment engine, APIs, process definition tool and administrative application',77,'2007-07-01 11:09:24'),('bsframework','The Bright Side Framework provides ready-to-use high level components to quickly build J2EE business applications accessed by rich java/Swing clients on HTTP.',77,'2007-07-01 11:09:24'),('c-jdbc','Clustered JDBC gives your applications a transparent (no code modification) access to a cluster of databases even if your database engines are not cluster-aware.',77,'2007-07-01 11:09:24'),('cardamom','CARDAMOM is a middleware framework that provides features to configure, deploy and execute near real-time, distributed and fault-tolerant applications.',77,'2007-07-01 11:09:24'),('carol','CAROL (Common Architecture for RMI Objectweb Layer) is a Java RMI (Remote Methods Invocation) management tool.',77,'2007-07-01 11:09:24'),('celtix','Celtix delivers a Java enterprise service bus (ESB) runtime and set of extensibility APIs, simplifying the construction, integration and flexible reuse of technical and business components using a standards-based, service-oriented architecture.',77,'2007-07-01 11:09:25'),('cow','Cooperative Open Workflow is a flexible workflow engine that can handle cooperative work activities',77,'2007-07-01 11:09:25'),('director','Enhydra Director implements web server plugins for Apache, IIS and IPlanet supporting advanced load balancing / clustering and runtime administration. Director can be used with plain Tomcat, Jetty, JBoss, JOnAS or Enhydra Server.',77,'2007-07-01 11:09:25'),('dods','Enhydra DODS is a code generating O/R mapping tool with true SQL queries for predictable performance, configurable templates and data/query caching. Can be used in standalone applications, every application server and of course with Enhydra Server.',77,'2007-07-01 11:09:25'),('dotnetj','DotNetJ is a middleware that gives .NET clients the ability to use Java components or J2EE applications. This project aims at providing .NET-to-Java interoperability without the bottleneck of web services.',77,'2007-07-01 11:09:25'),('dream','Dream is a component-based software framework dedicated to the construction of communication middleware. It provides a component library (based on Fractal) and tools allowing the construction of various communication paradigms.',77,'2007-07-01 11:09:25'),('dryverl','Dryverl is an XML dialect for specifying Erlang-to-C bindings as C port drivers, and a set of XSLT stylesheets that generate all of a binding\'s Erlang and C source code.',77,'2007-07-01 11:09:25'),('eaf','Enhydra Application Framework implements the Enhydra &quot;super-servlet&quot;, provides dynamic URL-JSESSIONID rewriting, PO caching, session-, database-, logging-, configuration- and XMLC APIs using adapters for different application servers.',77,'2007-07-01 11:09:25'),('eclipse-update','This project is used to manage the ObjectWeb Consortium Eclipse update sites (download.[fr2,us,zh].forge.objectweb.org/eclipse-update) which allow Eclipse users to download ObjectWeb plugins directly from Eclipse.',77,'2007-07-01 11:09:25'),('edemos','Enhydra Demos contains many applications showing various aspects of Enhydra tools and technologies like EAF, XMLC, DODS, Barracuda, Flash, FOP, XSLT, WAP/WML, VXML, SOAP, etc.',77,'2007-07-01 11:09:25'),('edm','A database modelling eclipse plugin for Java Data Objects. Supports the most popular Hibernate Persistence Framework.',77,'2007-07-01 11:09:25'),('enhydra','Enhydra Server is the leading Open Source Java/XML application server supporting latest Servlet and Webservice standards. Enhydra Enterprise is based on JOnAS and supports the full J2EE stack.',77,'2007-07-01 11:09:25'),('exoplatform','The eXo platform : ECM (JSR 170 impl) + Portlet and Service Container (JSR 168 CERTIFIED) + Portal based on Java Server Faces + Workflow + many portlets (forum, Wiki...)',77,'2007-07-01 11:09:25'),('federid','The FederID project aim to offer a real solution of Identity Management and Identity Federation. Built on existing free software, it profits of the support and the financing of the French National Agency of Research.',77,'2007-07-01 11:09:25'),('gotm','GoTM (GoTM is an open Transaction Monitor) is a component-based framework for building various transaction services. GoTM is developped with the Fractal component model.',77,'2007-07-01 11:09:25'),('howl','HOWL is a logger implementation providing features required by the JOTM project. HOWL uses unformatted binary logs to maximize performance and specifies a journalization API with methods necessary to support JOTM recovery operations.',77,'2007-07-01 11:09:25'),('interldap','InterLDAP is an identity management project based on a Java framework. Main goals are to solve self-management, provisioning, access control and profil management.',77,'2007-07-01 11:09:25'),('introspector','The introspector project aims to create a semantic interface into the GNU GCC compiler and other free tools. The data extracted will be useful for other object brokers. Currently hosted on sourceforge, we will be migrating the project to objectweb.',77,'2007-07-01 11:09:25'),('jac','Java Aspect Components (JAC) is a framework for aspect-oriented sofware development in Java.',77,'2007-07-01 11:09:25'),('jade','This project has not yet submitted a description.',77,'2007-07-01 11:09:25'),('jasmine','JASMINe is an administration tool for the SOA platform aiming to simplify the administrator\'s job and reduce the management costs. It relies on an autonomic system (Jade project) for implementing some autonomous behaviors (self-repair, self-healing).',77,'2007-07-01 11:09:25'),('javaservice','JavaService allows server-type Java programs to be run in the background as a Windows NT/2000/XP system service (aka Unix daemon process).',77,'2007-07-01 11:09:25'),('jawe','Enhydra JaWE is a graphical Java Workflow Editor according to WfMC specifications supporting XPDL as its native file format. JaWE can be used to edit workflow definitions for Enhydra Shark or every other XPDL conformant Workflow server.',77,'2007-07-01 11:09:25'),('jeffree','Java Embedded Framework Free. Based on OSGi v2.0 specification.',77,'2007-07-01 11:09:25'),('jmimetypelib','jmimetypelib is a java library used to find the mime-type of files and streams using file extension and/or magic numbers. Additionally it may return an icon to represent the mime-type file and a locale description.',77,'2007-07-01 11:09:25'),('jnetcontrol','Management and configuring network equipment with support to Telnet protocol ie: Cisco tm, 3COM.',77,'2007-07-01 11:09:25'),('jonas-doc','The jonas-doc project goal is to hold JOnAS documentation translations. The repository will contain one directory per language (French -&gt; jonas-doc-fr, German -&gt; jonas-doc-de, ...).',77,'2007-07-01 11:09:25'),('jonathan','Jonathan is an open source adaptable distributed object platform, which currently provides several personalities, including on compliant with the OMG CORBA specifications and another with the RMI specification.',77,'2007-07-01 11:09:25'),('joram','JORAM (Java Open Reliable Asynchronous Messaging) is an open source implementation of the JMS (Java Message Service) 1.1 API.',77,'2007-07-01 11:09:25'),('jorm','JORM (Java Object Repository Mapping) is an open source adaptable persistence service.',77,'2007-07-01 11:09:25'),('jotm','JOTM (Java Open Transaction Manager) is a fully functional open source standalone transaction manager that implements the XA protocol and is compliant with the JTA APIs.',77,'2007-07-01 11:09:25'),('jsurvey','The purpose of JSurvey is to provide tools for building online survey based on Java (J2EE) technologies. For the moment JSurvey is a started project so there is only a cvs repository with the sources of an online graphical survey example. see the cvs REA',77,'2007-07-01 11:09:26'),('kelp','Enhydra Kelp is the IDE plugin for JBuilder, Netbeans, Eclipse and JDeveloper integrating EAF, Enhydra XMLC and Enhydra DODS into your favorite development environment. It also includes an application wizard for your first steps.',77,'2007-07-01 11:09:26'),('kilim','Kilim is a generic configuration framework based on the concept of configuration by software assembly.',77,'2007-07-01 11:09:26'),('kilim2','This project has not yet submitted a description.',77,'2007-07-01 11:09:26'),('lemonldap','LemonLDAP is a single sign on handler for Apache web server. It manages several levels of cache and gets authentication data from an LDAP directory. It a project created and managed by  MINEFI (French economy ministary ). ',77,'2007-07-01 11:09:26'),('lewys','LeWYS is a Fractal monitoring framework providing a library of probes for both hardware and software resources. It provides monitoring pumps and repositories to efficiently gather, store and process the monitoring information.',77,'2007-07-01 11:09:26'),('lomboz','Lomboz is an eclipse plug-in for J2EE developers by extending eclipse JDT. It employs some of the proven open-source technologies. Supporting the complete development cycle: Code, deploy, test and debug.',77,'2007-07-01 11:09:26'),('maven','This project is used to manage the ObjectWeb\'s Maven Repository (maven.objectweb.org) which allows project managers using maven to use a commmon repository.',77,'2007-07-01 11:09:26'),('mesh','Mesh is a proxy for a remote JDBC driver, which can be accessed as though it were local. ',77,'2007-07-01 11:09:26'),('mobilitools','MobiliTools aims at providing a Java toolbox of independent but combinable and flexible software modules to support mobility of Java objects/agents, with a clear separation between activity, transport and communication concerns.',77,'2007-07-01 11:09:26'),('modfact','(Model Factory) is a Tool Box for the MDA(TM) (Model Driven Architecture)',77,'2007-07-01 11:09:26'),('navilis','Xcalia NAViLIS Web allows a developer to browse, query for, create, update, and delete business objects that are mapped to a live database. NAViLIS Web is like a database browser, except that the user navigates Java objects instead of database tables.',77,'2007-07-01 11:09:26'),('newsadmin','This project has not yet submitted a description.',77,'2007-07-01 11:09:26'),('noah','Noah is an implementation of an Interaction Service. &lt;br&gt;Interactions between components are described using a specific language (ISL). &lt;br&gt;Successive Adaptations are merged in a commutative and associative way.',77,'2007-07-01 11:09:26'),('obat','This project has not yet submitted a description.',77,'2007-07-01 11:09:26'),('objectweb-zh','ObjectWeb Chinese Project is a work in progress to translate ObjectWeb Document, localize ObjectWeb Projects and prompt ObjectWeb Open Source in China. This project serves as the file repository for the document translation effort.',77,'2007-07-01 11:09:26'),('ofccharts','OFC Charts fills the need for publishing reports and statistics in graphical format such as curves and histograms. Fully written in JAVA and compatible with all popular IDEs it creates graphics in industry standard JPEG, PNG and SVG formats.',77,'2007-07-01 11:09:26'),('oncepi','As an Integration-Oriented business process management system, OncePI project provides a platform to construct dynamic process flexibly and efficiently.',77,'2007-07-01 11:09:26'),('openccm','OpenCCM (Open CORBA Component Model platform) is the first public available open source implementation of the CCM (CORBA Component Model) defined by the OMG (Object Management Group).',77,'2007-07-01 11:09:26'),('openmobileis','Open Mobile IS is a Java framework that aim to provide all the functionalities and components needed for the developpement of entreprise mobile application.',77,'2007-07-01 11:09:26'),('ops','Orbeon Forms is an open source forms solution that handles the complexity of forms typical of the enterprise or government. It is delivered to standard web browsers thanks to XForms and Ajax technology, with no need for client-side software or plugins.',77,'2007-07-01 11:09:26'),('orchestra','Orchestra is a Web Service Orchestration Suite based on the OASIS standard BPEL (Business Process Execution Language). ',77,'2007-07-01 11:09:26'),('oscar','Oscar is an open source implementation of the Open Services Gateway Initiative (OSGi) framework.',77,'2007-07-01 11:09:26'),('oyster','Enhydra Oyster is a Java library for SMIME signing and encryption using different key strengths and algorithms. It is developed with suport and testing for major E-Mail clients.',77,'2007-07-01 11:09:26'),('pargres','ParGRES is a Database Cluster Middleware whose main goal is to efficiently process heavy-weight queries (e.g. OLAP). Our query processing combines intra and inter-query parallelism, while using replication and virtual fragmentation over a PC cluster.',77,'2007-07-01 11:09:26'),('petals','The PETALS Services Platform provides a distributed open source implementation of Java Business Integration (JBI) spec as a core element to build ObjectWeb ESB solutions, leveraging existing Consortium\'s components.',77,'2007-07-01 11:09:27'),('pkuas','JOnAS PKU is a light-weight application server prototype. It functions as component operating platform based on Java/J2EE technology. It aims at exploring advanced middleware features like easy of management, flexibility, and open to change.',77,'2007-07-01 11:09:27'),('polyorb','PolyORB is a schizophrenic middleware that has an original architecture decoupling protocol personalities from application personalities. PolyORB enables in the same middleware: configurability, genericity and M2M.',77,'2007-07-01 11:09:27'),('rfid','RFID project is a collection of RFID related components and middleware available from ObjectWeb\'s software stack.',77,'2007-07-01 11:09:27'),('rubbos','RUBBoS is a bulletin board benchmark modeled after an online news forum like Slashdot. It is used for design patterns and J2EE servers performance scalability evaluation. RUBBoS provides the essential bulletin board features such as discussion threads.',77,'2007-07-01 11:09:27'),('rubis','RUBiS is an auction site prototype modeled after eBay.com. It is used for design patterns and J2EE servers performance scalability evaluation.',77,'2007-07-01 11:09:27'),('s4allsdk','S4All-SDK is a toolkit to build a Java standard based service oriented platform',77,'2007-07-01 11:09:27'),('salome-tmf','SalomeTMF is a test management tool like TestDirector (trademark of Mercury Interactive Corporation), aiming to provide an open framework allowing, the automatic tests execution, the production of documents, and the management of defects/requirements.',77,'2007-07-01 11:09:27'),('shark','Enhydra Shark is a workflow server with a difference. Shark is completely based on standards from WfMC and OMG using XPDL as its native workflow definition language. The Shark framework can be configured to support different environments.',77,'2007-07-01 11:09:27'),('snapper','Enhydra Snapper is a fulltext search library / framework in Java based on Apache Lucene to build search engine applications or integrate fulltext search into applications.',77,'2007-07-01 11:09:27'),('soda','The SODA project will develop an ecosystem (runtime and tools) for building service-oriented systems running on embedded devices. Both a C/C++ and a Java (J2ME CDC) version will be developed.',77,'2007-07-01 11:09:27'),('sofa','SOFA provides a platform for designing applications composed of hierarchical, dynamically updatable components, interconnected by connectors hiding deployment details. Communication among the components can be captured formally by behavior protocols.',77,'2007-07-01 11:09:27'),('spago','Spago is a J2EE framework that provides a solution to the needs of multichannel applications and integration services. It allows to develop web applications,integrating existing infrastructures and publishing the services on different channels.',77,'2007-07-01 11:09:27'),('spago4q','Spago4Q  is a platform for assessing the maturity of the software development process and product, by evaluating data and measures collected from the development tools with non-invasive techniques, in order to improve the overall quality.',77,'2007-07-01 11:09:27'),('spagobi','SpagoBI is a Business Intelligence Free Platform which uses many FOSS tools as analytical engines, integrating them in an infrastructure which offers a cross-operativeness and a consistent vision between Report,OLAP,Data Mining,Dashboard and over the DWH',77,'2007-07-01 11:09:27'),('starwebservice','StarWebService is an independent platform for developing, deploying, managing and running Web Services.',77,'2007-07-01 11:09:27'),('stock-online','Stock-Online is the CSIRO application used to stress middleware performance and scalability. This open-source version is implemented in EJB 1.1, and provides two alternative design choices (Session bean + JDBC, and Session bean + CMP Entity beans).',77,'2007-07-01 11:09:27'),('surf','SURF (Fault Tolerance by Replication with Universal Services) is a Java library replication service for arbitrary deterministic objects. In crash situations objects can still be accessed with replication transparent to the application developer.',77,'2007-07-01 11:09:27'),('think','THINK is a software framework for building component-based system kernels. As an implementation of the Fractal model, it clearly separates architectural from functional apects, provides flexibility, encourages code re-use and reduces development time.',77,'2007-07-01 11:09:27'),('tox','This project has not yet submitted a description.',77,'2007-07-01 11:09:27'),('wcms','This project has not yet submitted a description.',77,'2007-07-01 11:09:27'),('wildcat','WildCAT is a Java toolkit/framework to make applications context-aware. It provides a simple and dynamic data model to represent the execution context of the application, which can be accessed both synchronously and synchronously (pull and push).',77,'2007-07-01 11:09:27'),('wsunit','WSUnit is a tool that can help you test Web Services. It provides a predictable and repeatable simulation of a Web Service that is ideal for unit testing.',77,'2007-07-01 11:09:27'),('xmlc','Enhydra XMLC radically simplifies web development by cleanly separating presentation from code.',77,'2007-07-01 11:09:27'),('xquare','The XQuare project provides a set of Java components for extending J2EE platforms with XML-based, heterogeneous information integration capabilities, using the XQuery language',77,'2007-07-01 11:09:27'),('xservice','XService suite, which is powered by ACT (The Institute of Advanced Computing Technology), Beihang University, Beijing, China, is a suite focus on xml and web service and provide fundamental element to enable service oriented architecture(SOA).',77,'2007-07-01 11:09:27'),('xwiki','XWiki is advanced wiki that supports many popular features like the Wiki syntax, version control, attachments, security, and searching, but also many advanced features like templates, database and dynamic development, skinability and much more.',77,'2007-07-01 11:09:27'),('zeus','Open source Java-to-XML Data Binding tool.',77,'2007-07-01 11:09:27');
